import './Header.css';
import HeaderLog from '../../images/logo.svg';
import Navigation from './Navigation/Navigation';
import ButtonAutchLogg from './ButtonAutchLogg/ButtonAutchLogg';
import { NavLink } from 'react-router-dom';

function Header(props) {


  return (
    <div className="header">
      <section className='header__user'>
        <NavLink to='/'>
          <img className="logo logo_place_header" src={HeaderLog} alt="Логотип" />
        </NavLink>
        <div className='header__user-movies'>
          {props.loggedIn
            ? <Navigation toggleBurger={props.toggleBurger} />
            : <ButtonAutchLogg />
          }
        </div>
      </section>
    </div>
  )
}

export default Header;
